#define SIMPLE_DEFAULT_IMGUI_TYPE( VAR )                        ToImGuiPointerSwitch( #VAR, &Value->VAR );
#define SIMPLE_DEFAULT_IMGUI_TYPE_MEMBER_PTR( class_name, VAR ) ToImGuInvokableSwitch( #VAR, Value, &class_name::VAR );

